import React from 'react';

function NewsPiece(props) {
  return (
  	<div className="card-box">
      <div className="news-piece-card-header">
        <div className="news-piece-card-title">
          <h2>${props.title}Студенческая оценка преподавания за 1 модуль у всех студентов</h2>
        </div>
        <div className="news-piece-card-time"><p>${props.time}45 мин</p></div>
      </div>
      <div className="news-piece-card-content">
      <p>${props.content}Внимание!<br></br>
      Стартовала Студенческая оценка преподавания
      за 1 модуль. Всем студентам необходимо оценить
      те дисциплины, по которым проводились
      аудиторные занятия и запланированы зачеты.</p>
      </div>
    </div>
  );
}

export default NewsPiece;
